import { Card, Category } from "../Card";

type props = {
  items: string[],
  clicked: (cat: string) => void,
}

export function Menu({items, clicked} : props) {
  return (
    <ul className='Menu'>
      {items.map(item => (
        <li><button onClick={() => clicked(item)}>{item}</button></li>
      ))}
    </ul>
  )
}
